import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import bgimage from "../../image/coins_on_chart.jpg"

axios.defaults.withCredentials = true;

function HomeComp() {
    let [data, setData] = useState([]);

    useEffect(() => {
        axios.get("http://140.116.214.154:3000/api/data/first")
        .then(res => {
            setData(res.data);
        }).catch(res => {
        })
    }, [])

    return (
        <>
            <div className = 'jumbotron jumbotron-fluid' style = {{ backgroundImage : `url(${bgimage})` }}>
                <h1 className = "display-4 text-center" style = {{ color : "white" }}>Financial Database</h1>
            </div>
        </>

    );
}

export default HomeComp;

